import React from "react";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <div className="w-64 bg-gray-800 text-white h-screen p-4">
      <h2 className="text-xl font-bold mb-6">Dashboard</h2>
      <ul>
        <li className="mb-4">
          <Link to="/events" className="text-gray-300 hover:text-white">Events</Link>
        </li>
        <li className="mb-4">
          <Link to="/attendees" className="text-gray-300 hover:text-white">Attendees</Link>
        </li>
        <li className="mb-4">
          <Link to="/tasks" className="text-gray-300 hover:text-white">Tasks</Link>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
